const Main = () => {

  return (
    <div class="main">
      <div class="main-left">przestrzeń do wykorzystania w późniejszych wersjach projektu</div>
      <div class="main-center">
        <Switch>
          <Route path='/addTask'>
            {/* <AddService /> */}
            <div>abc</div>
          </Route>
          <Route path="/">
            <ServicesList />
          </Route>
        </Switch>
      </div>
      <div class="main-right">przestrzeń do wykorzystania w późniejszych wersjach projektu</div>
    </div>
  );
};

export default Main;
